import './App.css';
import { Route, BrowserRouter, Switch, Redirect} from "react-router-dom"; 
import routes from './config/routes';
import { isRegistered } from './utils/cookie';

console.log(isRegistered());

const App = () => {
  return (
    <BrowserRouter>
      <Switch>
        {routes.map((route) => {
          if (isRegistered()) {
            return <Redirect to='/register' />
          } else {
            return <Redirect to='/' />
          }
        })}
      </Switch>
    </BrowserRouter>
  );
}

export default App;
